import React from 'react';
import {Form, Button} from 'react-bootstrap';
import axios from 'axios';

const initialFormData = Object.freeze({image: "", title: "", description: ""});

class AddNewMovie extends React.Component {

    render() {

        const {register, handleSubmit} = useForm();
        return (
            <React.Fragment>
                <h2>Pievienot jaunu filmu</h2>
                <Form className="mb-5">
                    <Form.Group>
                        <Form.Label>Image URL</Form.Label>
                        <Form.Control type="text" placeholder="Image URL"/>
                    </Form.Group>
                    <Form.Group>
                        <Form.Label>Title</Form.Label>
                        <Form.Control type="text" placeholder="Movie Title"/>
                    </Form.Group>
                    <Form.Group>
                        <Form.Label>Description</Form.Label>
                        <Form.Control type="text" placeholder="Movie Description"/>
                    </Form.Group>
                    <Button variant="primary" type="submit" onClick={this.postDataHandler}>
                        Submit
                    </Button>
                </Form>
            </React.Fragment>
        );
    }
}

export default AddNewMovie;
